function d3_geo_cartesian(n){var t=n[0],a=n[1],r=Math.cos(a);return[r*Math.cos(t),r*Math.sin(t),Math.sin(a)]}function d3_geo_cartesianDot(n,t){return n[0]*t[0]+n[1]*t[1]+n[2]*t[2]}function d3_geo_cartesianCross(n,t){return[n[1]*t[2]-n[2]*t[1],n[2]*t[0]-n[0]*t[2],n[0]*t[1]-n[1]*t[0]]}function d3_geo_cartesianAdd(n,t){n[0]+=t[0],n[1]+=t[1],n[2]+=t[2]}function d3_geo_cartesianScale(n,t){return[n[0]*t,n[1]*t,n[2]*t]}function d3_geo_cartesianNormalize(n){var t=Math.sqrt(n[0]*n[0]+n[1]*n[1]+n[2]*n[2]);n[0]/=t,n[1]/=t,n[2]/=t}